import React, { Fragment } from "react";
import * as layoutStyle from "layoutPage.module.css";

const Layout = (props) => {
  return (
    <Fragment>
      <div className={layoutStyle.container}>
        <h1 className={layoutStyle["text-center"]}>SHHH! Yahan Ana mana hai</h1>
        <div className={layoutStyle["button-group"]}>
          <button className={layoutStyle.btn}>Add Secret Message</button>
          <button className={layoutStyle.btn}>See All Secret Messages</button>
          <button className={layoutStyle.btn}>Find Secret Message</button>
        </div>
      </div>
    </Fragment>
  );
};

export default Layout;
